  projects being built for transportation and recreational use. rnrnTo learn more
  about Austinu2019s Sidewalk Program, visit austintexas.gov/sidewalks or drop us
  a line and share your feedback with us at the link below.rnrnhttp://austintexas.gov/online-form/feedback-sidewalk-master-plan-and-ada-transition-planrnrnThis
